import { Accordion, AccordionDetails, AccordionSummary, Typography } from '@mui/material';
import ExpandMoreIcon from '@mui/icons-material/ExpandMore'
import { useState } from "react"
import './App.css';
import { FirstMap } from './components/FirstMap';
import { GFMap } from './components/GFMap';
import { SFMap } from './components/SFMap';

// import { GroundMap } from './components/GroundMap';
// import { GroundMapp } from './components/GroundMapp';
// import { TestGround } from './components/TestGround'

function App() {
  const [expanded, setExpanded] = useState<string | false>(false)
  const handleChange = (isExpanded: boolean, panel: string) => {
    setExpanded(isExpanded ? panel : false)
  }
  return (
      <div className="App">
        <Accordion expanded={ expanded === 'panel1'} onChange={(event, isExpanded) => handleChange(isExpanded, 'panel1') }>
            <AccordionSummary id="panel1-header" aria-controls="panel1-content" expandIcon={<ExpandMoreIcon />}>
                <Typography>Accordion 1</Typography>
            </AccordionSummary>
            <AccordionDetails>
                <GFMap></GFMap>
            </AccordionDetails>
        </Accordion>
        <Accordion expanded={ expanded === 'panel2'} onChange={(event, isExpanded) => handleChange(isExpanded, 'panel2') }>
            <AccordionSummary id="panel2-header" aria-controls="panel2-content" expandIcon={<ExpandMoreIcon />}>
                <Typography>Accordion 2</Typography>
            </AccordionSummary>
            <AccordionDetails>
              <FirstMap></FirstMap>
            </AccordionDetails>
        </Accordion>
        <Accordion expanded={ expanded === 'panel3'} onChange={(event, isExpanded) => handleChange(isExpanded, 'panel3') }>
            <AccordionSummary id="panel3-header" aria-controls="panel3-content" expandIcon={<ExpandMoreIcon />}>
                <Typography>Accordion 3</Typography>
            </AccordionSummary>
            <AccordionDetails>
                <SFMap></SFMap>
            </AccordionDetails>
        </Accordion>

        {/* <FirstMap></FirstMap> */}
        {/* <SFMap></SFMap> */}
        {/* <GroundMap></GroundMap> */}
        {/* <GroundMapp></GroundMapp> */}
        {/* <TestGround></TestGround> */}
      </div>
  )
}

export default App;
